import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Import Routes and Route from react-router-dom
import Login from '../Components/Login/Login';
// import Home from '../Components/Home/Home'; // Uncomment if you need the Home component

const app = () => {
  return (
    <Routes>
      {/* Uncomment and modify the line below if you want to add a route for the Home component */}
      {/* <Route path='/' element={<><Private/><Navbar/><Sidebar/><Home/></>} /> */}
      <Route path='/login' element={<Login />} />
    </Routes>
  );
}

export default app;
